import React from 'react';
import './App.css';
const mqtt = require('mqtt')
const client  = mqtt.connect('mqtt://test.mosquitto.org')

function App() {
  client.on('message', (topic: any, msg: any) => {
    console.log('received message')
    console.log(msg.toString())
    client.end()
  })

  return (
    <div className="App">

    </div>
  );
}

export default App;
